// DEP.
import React, { Component } from 'react'

// CSS
import '../css/App.css'
import '../css/Resume.css'
import WOW from 'wowjs';

// IMAGES
import LinkedIn from '../Images/LinkedIn.png';
import Email from '../Images/email.png';
import GitHub from '../Images/github.png';
import LambdaStamp from '../Images/LambdaStamp.png'

export default class Footer extends Component {

    state = {

        active: false

    }

    toGitHub = () => {

        window.location.href = 'https://github.com/MaxGunter99'

    };

    toLinkedIn = () => {

        window.location.href = 'https://www.linkedin.com/in/michael-gunter-5383a0181/'

    };

    toEmail = () => {

        window.location.href = "mailto:Michael.Alex.Gunter@gmail.com";

    };

    componentDidMount() {

        new WOW.WOW().init();

    };

    render() {

        return (

            <footer>

                <img src={LambdaStamp} alt='LambdaStamp' data-wow-duration="1s" />
                <img src={GitHub} alt='FooterImage' className = 'FooterImage' data-wow-duration="1s" onClick={ () => this.toGitHub() } />
                <img src={LinkedIn} alt='FooterImage' className = 'FooterImage' data-wow-duration="1s" onClick={ () => this.toLinkedIn() } />
                <img src={Email} alt='FooterImage' className = 'FooterImage' data-wow-duration="1s" onClick={ () => this.toEmail() } />

            </footer>

        )
    }
}
